import NavBar from '../../components/navbar/navbar'
import dynamic from 'next/dynamic'

const Contact = dynamic( 
    () => import('../components/contact/contact'),
    { ssr: false } 
);


export default function Main(props) {
    return ( 
        <div>
            <Contact/>
            <NavBar selected='PROJECTS'/>
        </div> 
    )
}
